import React from 'react'
import Navbar from 'react-bootstrap/Navbar'
import 'bootstrap/dist/css/bootstrap.min.css';
function App() {
  return (
    <div style={margin=10}>
      <Navbar bg="dark" variant="dark">
      <Navbar.Brand href="">Alumni Tracking System</Navbar.Brand>
      </Navbar>
    </div>);
}

export default App
